import React from 'react'

const Services = () => {
  return (
    <>
    <section className='services-main-container'>
        <div className='container services-container'>
            <h1 className='main-heading text-center fw-bold'>
                How to send money
            </h1>
        </div>
    </section>
    </>
  )
}

export default Services;
